import styled from "styled-components";

export const Container = styled.div`
  position: fixed;
  bottom: 0;
  left: 0;
  min-height: 80vh;
  width: 100vw;
  background-color: rgba(12, 12, 12, 0.95);
  z-index: -10;
  color: #fff;
  display: flex;
  flex-direction: column;
  justify-content: center;
`;
